import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';
import { AccountBank } from './account-bank';

@Injectable({
  providedIn: 'root'
})
export class AccountBankService {

  private baseURL = "http://localhost:8080/api/v1/account-banks";

  constructor(private httpClient: HttpClient) { }

  getAccountBanks(): Observable<AccountBank[]>{
    return this.httpClient.get<AccountBank[]>(`${this.baseURL}`);
  }

}
